def lzw_compress(s):
    """"""
    dictionary_size = 256
    dictionary = {chr(i): i for i in range(dictionary_size)}
    w = ''
    result = []
    for c in s:
        wc = w + c
        if wc in dictionary:
            w = wc
        else:
            result.append(dictionary[w])
            dictionary[wc] = dictionary_size
            dictionary_size += 1
            w = c
    if w:
        result.append(dictionary[w])
    return ', '.join((str(x) for x in result))
